import Vue from 'vue';
import App from './App.vue';
import router from './router';  // Asegúrate de que este path sea correcto

Vue.config.productionTip = false;

new Vue({
  router, // Aquí agregamos el router
  render: h => h(App),
}).$mount('#app');
